import React from 'react'
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import expositores from './expositores/Expositores';
import './style.css'
import logo from '../image/MARCA_CASA&CIA-07.png';
import Menu from './menus/Menu';
import ButtonsPrincipais from './buttonsPrincipais/ButtonsPrincipais';
import Footer from './footer/Footer';

const index = () => {
  return (
    <div>
      <img className='logo' src={logo} alt="logo" />
      <Menu />
      <ButtonsPrincipais />
      <Footer />
      <Routes>
      <Route path="./expositores/Expositores" component={expositores} />
      <Route path="/" component={Menu} />
    </Routes>
    </div>
  )
}

export default index;
